import React, {useState} from 'react';
import Button from '@material-ui/core/Button';
import ReactDOM from 'react-dom';
import './Landing.css';
import Typography from '@material-ui/core/Typography';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/core/MenuItem';
import { makeStyles } from '@material-ui/core/styles';


const LandingPageFunction = () =>{
    return (
      <div id ="body">
        <Header/>
        <Card/>
      </div>
    )
  }

  const Header = () => {
    return(
    <div className='header'>
      <span className='header-title'>
        Autonymous
        </span>
        <br/>
      <span className="header-text">
        Qual tipo de serviço você procura?
        </span>
        </div>);
        }

  const Card = (props) => {
    return(
      <div className={props.className} >
        <div className="small-div">
          <i className={props.className}></i>
          <img src={props.img} alt=''/>
        </div>

      <div className="big-div">
        <span className='div-title'>
              {props.title}
        </span>
        <br/>
      <span>
        {props.description}
      </span>
    </div>
      </div>
    )
  }
ReactDOM.render(<LandingPageFunction/>, document.getElementById('root'));
        export default LandingPageFunction;
